 shows the highest positive sentiment score.\n","* Comparatively, store 14 (1650 Washington Ave, Miami Beach) shows the higest negative sentiment score.\n","* 28/40 stores are showing positive sentiment scores, which indicates good client satisfaction, while indicating room for possible improvements for those with negative scores.\n","* It is interesting to note that the negative sentiment score reported is way lower than the positive sentiment score reported on the scale."]},{"cell_type":"markdown","id":"a3fb549f","metadata":{"papermill":{"duration":0.022682,"end_time":"2023-12-26T19:59:25.803606","exception":false,"start_time":"2023-12-26T19:59:25.780924","status":"completed"},"tags":[]},"source":["# References\n","\n","Dataset:\n","Elgiriyewithana, N. (2023) ‘McDonald’s Store Reviews’. "]}],"metadata":{"kaggle":{"accelerator":"none","dataSources":[{"datasetId":3422393,"sourceId":5968827,"sourceType":"datasetVersion"}],"dockerImageVersionId":30618,"isGpuEnabled":false,"isInternetEnabled":false,"language":"r","sourceType":"notebook"},"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":21.988733,"end_time":"2023-12-26T19:59:25.947688","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2023-12-26T19:59:03.958955","version":"2.5.0"}},"nbformat":4,"nbformat_minor":5}